    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 21 21"
      width="28"
      height="28"
    >
      <path
        d="M11.5 14.5l-4-4 4-4"
        fill="none"
        stroke="#FFF"
        strokelinecap="round"
        stroke-linejoin="round"
      />
    </svg>
  );
};

